import React from 'react';
import PropTypes from "prop-types";
import { Text, StyleSheet } from 'react-native';
import { Container, Content, View } from "native-base";
import { Col, Row, Grid } from "react-native-easy-grid";
import Icon from 'react-native-vector-icons/EvilIcons';
import Header from "../../components/Header";
import Typography from '../../components/Typography';
import global from "../../utils/GlobalStyles";

const styles = StyleSheet.create({
  pageCard: {
    borderWidth: 1,
    borderColor: "#E5E5E5",
    borderRadius: 8,
  },
  cardIcon: {
    height: 35,
    width: 35,
    borderRadius: 35,
    borderWidth: 1,
    borderColor: "#E5E5E5",
    backgroundColor: "rgb(245, 245, 245)",
    justifyContent: "center",
    alignItems: 'center',
    marginHorizontal: 15,
  },
  pageImage: {
    backgroundColor: "#E5E5E5",
    height: 180,
    justifyContent: 'center',
    alignItems: 'center',
    flex: 1,
  },
  rowContent: {
    alignItems: 'center',
    flex: 1,
    paddingTop: 20,
  },
});

export default function InterestRateInfo({ navigation }) {
  return (
    <Container style={global.wrapper}>
      <Header close closeAction={() => navigation.navigate("OnboardingEmergencyFund")} transparent />

      <Content>
        <View style={global.content}>
          <Typography type="title2" text="Interest Rate" />

          <Grid style={global.body}>

            <Row size={4}>
              <View style={styles.pageImage}>
                <Icon name="image" size={30} />
              </View>
            </Row>

            <Row size={4} style={global.fieldSeparator}>
              <Col>
                <Typography text="Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua." type="body" />
              </Col>
            </Row>

            <Row size={4} style={global.fieldSeparator}>
              <Col>
                <View style={styles.pageCard}>
                  <Grid>
                    <Col>
                      <Row size={2} style={styles.rowContent}>
                        <View style={styles.cardIcon}>
                          <Text style={{ fontSize: 8 }}>Icon</Text>
                        </View>
                        <Typography text="Want a higher interest rate?" type="body-bold" />
                      </Row>
                      <Row size={3} style={{ paddingLeft: 65, paddingBottom: 15 }}>
                        <Typography text="Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore." type="body" />
                      </Row>
                    </Col>
                  </Grid>
                </View>
              </Col>
            </Row>

            <Row size={4} style={global.fieldSeparator}>
              <Col>
                <Typography text="Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum." type="body" />
              </Col>
            </Row>
          </Grid>
        </View>
      </Content>
    </Container>
  );
}

InterestRateInfo.propTypes = {
  navigation: PropTypes.objectOf(PropTypes.any).isRequired,
};
